import React from 'react';
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, Container, NavDropdown } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Navigation.css'; // Add this line to import your custom CSS

const Navigation = () => {
  return (
    <Navbar expand="lg" className="custom-navbar flex-column">
      <Container className="d-flex align-items-center">
        <Navbar.Brand className="logo-container">
          <img
            src={`${process.env.PUBLIC_URL}/img/sp-logo.svg`}
             // Increase the height for better visibility
            className="d-inline-block align-top logo"
            alt="Stackpackers Logo"
          />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav" className="justify-content-center">
          <Nav className="align-items-center custom-nav">
            <Nav.Link as={NavLink} to="/" exact>Home</Nav.Link>
            <Nav.Link as={NavLink} to="/about">About</Nav.Link>
            <Nav.Link as={NavLink} to="/music">Music</Nav.Link>
            <Nav.Link as={NavLink} to="/events">Events</Nav.Link>
            <Nav.Link as={NavLink} to="/contact">Contact</Nav.Link>
          </Nav>
          <Nav className="ms-auto d-lg-none">
            <NavDropdown title="Menu" id="collasible-nav-dropdown">
              <NavDropdown.Item as={NavLink} to="/" exact>Home</NavDropdown.Item>
              <NavDropdown.Item as={NavLink} to="/about">About</NavDropdown.Item>
              <NavDropdown.Item as={NavLink} to="/music">Music</NavDropdown.Item>
              <NavDropdown.Item as={NavLink} to="/events">Events</NavDropdown.Item>
              <NavDropdown.Item as={NavLink} to="/contact">Contact</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Navigation;
